DELIMITER $$
CREATE TRIGGER `ai_mm_ferti_soc` AFTER INSERT ON `mm_ferti_soc` FOR EACH ROW Begin
If new.stock_point_flag='Y' then 
values(new.created_dt,new.district,new.soc_id,new.stock_point_flag);
End If;
values(new.soc_id,new.soc_name,new.district);
values(new.soc_id+1,concat('Advance ' ,new.soc_name),new.district);
end
$$
DELIMITER ;
