DELIMITER $$
CREATE TRIGGER `advance_rectify_voucher` AFTER INSERT ON `tdf_advance_voucher` FOR EACH ROW BEGIN
DECLARE    ls_csh_bnk    varchar(10);
DECLARE    ls_acc_code   varchar(10) DEFAULT '0';
DECLARE    ld_adv_code   integer;
declare    ld_vou_id     integer;
SELECT cshbnk_flag
INTO   ls_csh_bnk
FROM   tdf_advance
where  receipt_no = new.receipt_no;
IF ls_csh_bnk = '1' THEN
   select acc_code
   into   ls_acc_code
   FROM   mm_feri_bank
   WHERE  sl_no = new.bank;
END IF;
SELECT adv_acc
INTO   ld_adv_code
FROM   mm_ferti_soc
where  soc_id = new.soc_id;
SELECT max(sl_no) + 1
INTO   ld_vou_id
FROM   td_vouchers;
VALUES(new.trans_dt,
 ld_vou_id,ld_vou_id,
 new.branch_id,
 new.receipt_no,
 new.trans_dt,
 'A',
 'T',
 'J',
 'A',
 ls_acc_code,
 'Dr',
 new.adv_amt,
 null,null,null,
 new.remarks,
 'A',
 null,
 new.created_by,
 new.created_dt,
 new.modifed_by,
 new.modifed_dt,
 null,null,fin_yr);
 
VALUES(new.trans_dt,
 ld_vou_id,ld_vou_id,
 new.branch_id,
 new.receipt_no,
 new.trans_dt,
 'A',
 'T',
 'J',
 'A',
 ld_adv_code,
 'Cr',
 new.adv_amt,
 null,null,null,
 new.remarks,
 'A',
 null,
 new.created_by,
 new.created_dt,
 new.modifed_by,
 new.modifed_dt,
 null,null,fin_yr);
 
 END
$$
DELIMITER ;

